import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo tienda" />
        <p>
          Welcome <code>to my E-commerce</code>
        </p>
      </header>
    </div>
  );
}

export default App;
